import React from 'react';

export const Name = ({ children }) => (
  <p style={{ fontWeight: 'bold', margin: '0.5em 0' }}>
    {children}
  </p>
);

const Arrow = () => (
  <span
    style={{
      color: '#006dd4',
      fontWeight: '900',
      position: 'absolute',
      marginLeft: '-75px'
    }}
  >
    â†’
  </span>
);

export const Pattern = ({ active, title, desc }) => (
  <div
    style={{
      margin: '32px 0',
      color: active ? undefined : '#888'
    }}
  >
    {active ? (
      <div style={{ margin: '48px 0' }}>
        <h3 style={{ margin: '16px 0' }}>
          <Arrow /> {title}
        </h3>
        <p style={{ fontSize: '0.875em', margin: 0 }}>{desc}</p>
      </div>
    ) : (
      <p style={{ margin: '16px 0' }}>{title}</p>
    )}
  </div>
);

export const Patterns = ({ active, patterns }) => (
  <div>
    {patterns.map(({ title, desc }, i) => (
      <Pattern
        key={title}
        active={active === i + 1}
        title={`${i + 1}. ${title}`}
        desc={desc}
      />
    ))}
  </div>
);

export const PatternsSummary = ({ patterns }) => (
  <ol>
    {patterns.map(({ title }) => (
      <li key={title} style={{ margin: '0.5em 0' }}>
        {title}
      </li>
    ))}
  </ol>
);

export const FiltersOpen = () => (
  <img src="data:image/png;base64," />
);

export const FiltersClosed = () => (
  <img src="data:image/png;base64," />
);
